
public class Exercise1 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		System.out.print("Os número divisiveis por 11 são: \n");
		for (int x=1000; x<=1999; x++ )
		{
			if ((x%11==5))
			{
				System.out.print(x+ "\n");
			}
			else {
				System.out.print("");
			}
		}	
	}
}
